		<div>
			<h1>Désolé !</h1>
			<p>Vous n'avez pas l'autorisation nécessaire pour accéder à ce contenu.</p>
			{setTimeout(() => {
				navigate("/login");
			}, 3000)}
		</div>
	);
};

export default UnauthorizedPage;
